#!/usr/bin/env node
import { mkdir, writeFile } from 'node:fs/promises'
import { dirname, resolve } from 'node:path'
import { fileURLToPath } from 'node:url'

const __filename = fileURLToPath(import.meta.url)
const __dirname = dirname(__filename)
const projectRoot = resolve(__dirname, '..')

const assets = [
  {
    path: "public/icons/icon-192.png",
    base64: ""
  },
  {
    path: "public/icons/icon-192-maskable.png",
    base64: ""
  },
  {
    path: "public/icons/icon-512.png",
    base64: ""
  },
  {
    path: "public/icons/icon-512-maskable.png",
    base64: ""
  },
  {
    path: "public/screenshots/home-1080x1920.png",
    base64: ""
  },
  {
    path: "public/screenshots/home-1920x1080.png",
    base64: ""
  },
]

async function ensureAsset ({ path, base64 }) {
  const absolute = resolve(projectRoot, path)
  await mkdir(dirname(absolute), { recursive: true })
  const buffer = Buffer.from(base64, 'base64')
  await writeFile(absolute, buffer)
  return absolute
}

async function main () {
  const results = await Promise.all(assets.map(ensureAsset))
  for (const file of results) {
    console.log(`Generated ${file}`)
  }
}

main().catch(error => {
  console.error(error?.message || error)
  process.exitCode = 1
})
